import "./App.css";

const App = () => {
  let currentDate = new Date();
  function updateDate() {
    currentDate.setDate(currentDate.getDate() + 1);
    let updatedDate = currentDate.toDateString();
    return updatedDate;
  }
  return (
    <div className="container">
      <div className="steps">
        <button className="prev_step">-</button>
        <p>Step: 1</p>
        <button className="next_step">+</button>
      </div>
      <div className="steps">
        <button className="prev_count">-</button>
        <p>Count: 0</p>
        <button className="next_count">+</button>
      </div>
      <p>Today is {currentDate.toDateString()}</p>
    </div>
  );
};

export default App;
